import '../../styles/Footer.css'

function Footer() {

    return (
        <footer>
            <div>
                <a href="https://github.com/Rean18">
                <img src="/assets/icons/github-footer.png" alt="icône de GitHub" />
                </a>

            </div>
            <p>Tous droits réservés</p>
        </footer>
    )
}

export default Footer;
